import React, { useState, useEffect, useRef } from 'react';
import './App.css';
import ConnectionStatus from './components/ConnectionStatus';
import MarketSummary from './components/MarketSummary';
import MarketSelector from './components/MarketSelector';
import SignalDisplay from './components/SignalDisplay';
import HistoricalChart from './components/HistoricalChart';
import { convertSignalsToMarketFormat } from './utils/dataProcessing';

function App() {
  const [environment, setEnvironment] = useState('prod');
  const [selectedMarket, setSelectedMarket] = useState('');
  const [marketData, setMarketData] = useState({});
  const [scoreHistory, setScoreHistory] = useState([]);
  const [connectionStatus, setConnectionStatus] = useState('DISCONNECTED');
  const [lastUpdate, setLastUpdate] = useState(null);
  const wsRef = useRef(null);

  const websocketUrl = environment === 'local' 
    ? 'ws://localhost:8765' 
    : 'ws://134.209.184.5:8765';

  useEffect(() => {
    const connect = () => {
      if (wsRef.current) {
        wsRef.current.close();
      }

      console.log(`Connecting to ${websocketUrl}`);

      try {
        const ws = new WebSocket(websocketUrl);

        ws.onopen = () => {
          console.log('âœ… Connected successfully!');
          setConnectionStatus('Connected');
          // Send initial request
          ws.send(JSON.stringify({ type: 'get_latest' }));

          // Set up periodic requests
          const interval = setInterval(() => {
            if (ws.readyState === WebSocket.OPEN) {
              ws.send(JSON.stringify({ type: 'get_latest' }));
            }
          }, 5000);

          ws.interval = interval;
        };

        ws.onmessage = (event) => {
          console.log('ðŸ“¨ Raw data received:', event.data);
          try {
            const data = JSON.parse(event.data);
            console.log('ðŸ“¦ Parsed data:', data);

            if (data.type === 'pong') return;

            // Process the data
            let processedData;

            if (data.signals_by_market) {
              processedData = convertSignalsToMarketFormat(data);
            } else if (data.data && data.data.signals_by_market) {
              processedData = convertSignalsToMarketFormat(data.data);
            } else if (data.data) {
              processedData = data.data;
            } else {
              processedData = data;
            }

            console.log('ðŸŽ¯ Final processed data:', processedData);

            if (processedData && Object.keys(processedData).length > 0) {
              setMarketData(processedData);
              setLastUpdate(new Date());

              // Auto-select first market if needed
              const markets = Object.keys(processedData);
              setSelectedMarket(prev => {
                if (!prev || !processedData[prev]) {
                  console.log('Auto-selecting market:', markets[0]);
                  return markets[0];
                }
                return prev;
              });
            }
          } catch (error) {
            console.error('âŒ Error processing data:', error);
          }
        };

        ws.onerror = (error) => {
          console.error('âŒ WebSocket error:', error);
          setConnectionStatus('ERROR');
        };

        ws.onclose = (event) => {
          console.log('ðŸ”Œ WebSocket closed:', event.code);
          setConnectionStatus('DISCONNECTED');
          if (ws.interval) clearInterval(ws.interval);

          // Reconnect after delay
          setTimeout(() => {
            connect();
          }, 5000);
        };

        wsRef.current = ws;
      } catch (error) {
        console.error('âŒ Failed to connect:', error);
        setConnectionStatus('ERROR');
      }
    };

    connect();

    return () => {
      if (wsRef.current) {
        if (wsRef.current.interval) {
          clearInterval(wsRef.current.interval);
        }
        wsRef.current.close();
      }
    };
  }, [websocketUrl]);

  // Update score history when data changes
  useEffect(() => {
    if (marketData[selectedMarket]) {
      const marketInfo = marketData[selectedMarket];
      const longData = marketInfo.Long || {};
      const shortData = marketInfo.Short || {};

      const longScore = longData.final_score || 0;
      const shortScore = shortData.final_score || 0;

      const netDifference = Math.abs(longScore - shortScore);
      const winner = longScore > shortScore ? 'LONG' : shortScore > longScore ? 'SHORT' : 'NEUTRAL';

      setScoreHistory(prev => {
        const newHistory = [...prev, {
          timestamp: new Date(),
          longScore,
          shortScore,
          netDifference,
          winner
        }];

        const fiveMinutesAgo = new Date(Date.now() - 5 * 60 * 1000);
        return newHistory.filter(item => item.timestamp > fiveMinutesAgo);
      });
    }
  }, [marketData, selectedMarket]);

  const availableMarkets = Object.keys(marketData).sort();

  return (
    <div className="app">
      <header className="app-header">
        <h1>ImpViz Active Trader</h1>
        <ConnectionStatus 
          status={connectionStatus} 
          lastUpdate={lastUpdate}
        />
      </header>

      <div className="controls">
        <MarketSelector 
          markets={availableMarkets}
          selectedMarket={selectedMarket}
          onMarketChange={setSelectedMarket}
        />
        <button 
          className="env-toggle"
          onClick={() => setEnvironment(env => env === 'prod' ? 'local' : 'prod')}
        >
          {environment === 'prod' ? 'Production' : 'Local'}
        </button>
      </div>

      <MarketSummary marketData={marketData} />

      {/* Debug info */}
      <div style={{ 
        background: 'rgba(0,0,0,0.5)', 
        padding: '10px', 
        margin: '10px 0',
        borderRadius: '5px',
        fontSize: '11px',
        color: '#888'
      }}>
        <div>Markets available: {availableMarkets.join(', ') || 'None'}</div>
        <div>Selected market: {selectedMarket}</div>
        <div>Has data for selected: {marketData[selectedMarket] ? 'Yes' : 'No'}</div>
        <div>Data keys: {Object.keys(marketData).join(', ') || 'None'}</div>
      </div>

      {marketData[selectedMarket] ? (
        <>
          <SignalDisplay 
            marketData={marketData[selectedMarket]}
            marketName={selectedMarket}
          />
          <HistoricalChart scoreHistory={scoreHistory} />
        </>
      ) : (
        <div style={{
          padding: '20px',
          textAlign: 'center',
          color: '#666'
        }}>
          No data available for {selectedMarket}
        </div>
      )}
    </div>
  );
}

export default App;
